USE booking;


DROP TABLE IF EXISTS `accommodation`;

CREATE TABLE `accommodation` (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `category_name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Название категори',
  `board` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Тип питания',
  `main_places` int(11) NOT NULL COMMENT 'Количество проживающих на основных местах',
  `addition_places` int(11) NOT NULL COMMENT 'Количество проживающих на дополнителных местах',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Справочник категорий размещения';


-- актуализация данных в таблицы accommodation
DROP TABLE IF EXISTS `boards`;
CREATE TEMPORARY TABLE boards (boards varchar (100));

('Без питания'),
('Двухразовое питание'),
('Трёхразовое питание'),
('Всё включено'),
('Завтрак - шведский стол'),
('Завтрак - меню'),
('Двухразовое питание с напитками')
;
UPDATE accommodation 
SET accommodation.board  = (SELECT boards FROM boards ORDER BY RAND() LIMIT 1); 

DROP TABLE IF EXISTS `category_names`;
CREATE TEMPORARY TABLE category_names (category_name varchar (100));
;

UPDATE accommodation 
SET accommodation.category_name  = (SELECT category_name FROM category_names ORDER BY RAND() LIMIT 1); 

UPDATE accommodation 
SET accommodation.created_at  =
(
    FROM_UNIXTIME(
        UNIX_TIMESTAMP('2020-01-01 14:53:27') + FLOOR(0 + (RAND() * 23072000))
    )
); 

UPDATE accommodation 
SET accommodation.updated_at  =
(
    FROM_UNIXTIME(
        UNIX_TIMESTAMP('2021-01-01 14:53:27') + FLOOR(0 + (RAND() * 15768000))
    )
); 

UPDATE accommodation
SET accommodation.updated_at = NOW()
WHERE 
updated_at < created_at 
;

