#
# TABLE STRUCTURE FOR: orders
#

DROP TABLE IF EXISTS `orders`;

CREATE TABLE `orders` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `OrderCode` varchar(15) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Код заказа',
  `user_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на пользователя',
  `hotel_id` int(10) unsigned DEFAULT NULL COMMENT 'Ссылка на справочник отелей',
  `accommodation_id` int(10) unsigned DEFAULT NULL COMMENT 'Ссылка на справочник категорий размещения',
  `checkin_date` date NOT NULL COMMENT 'Дата начала проживания',
  `checkout_date` date NOT NULL COMMENT 'Дата окончания проживания',
  `stay_leght` int(11) NOT NULL COMMENT 'Продолжительность проживания (количество ночей)',
  `stay_cost` float NOT NULL COMMENT 'Стоимость пакета проживания',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `OrderCode` (`OrderCode`)
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Заказы пользователей сервиса';


-- Актуализация данных в таблице Orders

UPDATE orders 
SET orders.created_at  =
(
    FROM_UNIXTIME(
        UNIX_TIMESTAMP('2019-01-01 14:53:27') + FLOOR(0 + (RAND() * 78840000))
    )
); 

UPDATE orders 
SET orders.updated_at   =
(
    SELECT  ADDDATE(orders.created_at , INTERVAL FLOOR(1 + RAND() * 100) DAY)
);

UPDATE orders SET OrderCode = 
(SELECT ordercode FROM
	(
SELECT
orders.id,
CONCAT(
	UPPER(LEFT(resorts.name,3)),
	DATE_FORMAT(orders.checkin_date,'%y%m%d'),
	LPAD(orders.user_id, 6,'0')
) ordercode 
FROM orders 
INNER JOIN hotels ON hotels.id = orders.hotel_id
INNER JOIN resorts ON resorts.id = hotels.resort_id

	) AS a where a.id = orders.id 
);


